import React from "react"
import ContentLoader from "react-content-loader"

const CardSkeleton = (props) => (
  <ContentLoader 
    speed={1}
    width={261}
    height={443}
    viewBox="0 0 261 443"
    backgroundColor="#c7c7c7"
    foregroundColor="#ffffff"
    {...props}
  >
    <circle cx="130" cy="130" r="130" /> 
    <rect x="11" y="272" rx="5" ry="5" width="245" height="90" /> 
    <rect x="10" y="374" rx="5" ry="5" width="247" height="22" /> 
    <rect x="70" y="404" rx="5" ry="5" width="129" height="34" />
  </ContentLoader>
)

export default CardSkeleton
